import React, { Component } from 'react';

import './Board.css';

class Board extends Component {
    constructor(props) {
        super(props);
        this.state={
            gameBoard: Array(100).fill(null)
        }
}




  render() {
    return (
        <div className="board">
          <div className="App">
            <h1>hello</h1>
            {this.state.gameBoard.map((el,i) => (
                <div className="box i" id={i}>{i}</div>
            ))}
          </div>
        </div>
    );
  }
}

export default Board;
